import styled from "styled-components";
import { Icon, Heading } from "../components";

const User_Overview = ({ name, player = [] }) => {
  return (
    <div className="Dash_Overview">
      <span>
        <Heading>{name}</Heading>
        <Icon type="soccer" />
      </span>
      <span>
        {player.map(({ sport, name: n }) => (
          <>
            <Heading>{n}</Heading>
            <Icon type={sport} />
          </>
        ))}
      </span>
    </div>
  );
};

export default User_Overview;
